function App() {
  return (
    <Router>
      <Navigation/>
      <Routes>
        <Route path="/" exact element={<NotesList />} />
        <Route path="/edit/:id" element={<CreateNote />} />
        <Route path="/create" element={<CreateNote />} />
        <Route path="/user" element={<CreateUser />} />
      </Routes>
    </Router>
  );
}
